import { Container } from "react-bootstrap";
import { useDispatch } from "react-redux";

function TourRule() {
    const tour = useDispatch((state) => state.tour)

    return (
        <Container className="mt-5">
            <h3 className="bg-danger text-center text-white">Quy định giải đấu</h3>
        </Container>
    );
}

export default TourRule;
